import { SummaryData, OverviewData } from './data.js';
import './css/app.css';

function Info(props) {
  return (
    <div className=''>
      <div className='card1 bg-cd vcenter vflex grid20'>
        <div className='flex grid10 vcenter'>
          <img src={props.icon} alt='fb logo' className=""/>
          <span className='username'>{props.username}</span>
        </div>
        <div>
          <div className='bigNum center'>{props.number}</div>
          <p className='followers center'>{props.param}</p>
        </div>
        <div className='flex grid10 vcenter'>
          <img src={props.caret} />
          <span className=''>{props.figure + ' Today'}</span>
        </div>
      </div>
    </div>
  )
}

function Today({param, icon, number, caret, figure}) {
  return (
    <div className=''>
      <div className=''>
        <div className='flex grid20 bg'>
          <span className=''>{param}</span>
          <img src={icon} alt='fb logo' />
          <div className=''>{number}</div>
          <div className='flex'>
            <img src={caret} />
            <span className=''>{figure + '%'}</span>
          </div>
        </div>
      </div>
    </div>
  );
}

function Summary() {
  return (
    <div className='flex grid50 columns100'>
      <div className='wrapper columns25'>
        <div className='topbar bg-fb'></div>
        <Info
          icon={SummaryData[0].icon}
          username={SummaryData[0].username}
          number={SummaryData[0].number}
          param={SummaryData[0].param}
          caret={SummaryData[0].caret}
          figure={SummaryData[0].figure}
        />
      </div>
      <div className='wrapper columns25'>
        <div className='topbar bg-tw'></div>
        <Info {...SummaryData[1]}/>
      </div>
      <div className='wrapper columns25'>
        <div className='topbar bg-ig'></div>
        <Info {...SummaryData[2]}/>
      </div>
      <div className='wrapper columns25'>
        <div className='topbar bg-yt'></div>
        <Info {...SummaryData[3]}/>
      </div>

    </div>
  ); 
}

function Overview() {
  return (
    <div className=''>
      <div className=''>
        <Today
          param={OverviewData[0].param}
          icon={OverviewData[0].icon}
          number={OverviewData[0].number}
          caret={OverviewData[0].caret}
          figure={OverviewData[0].figure}
        />
      </div>
      <div className=''>
        <Today  {...OverviewData[1]} />
      </div>
      <div className=''>
        <Today {...OverviewData[2]} />
      </div>
      <div className=''>
        <Today {...OverviewData[3]} />
      </div>

    </div>
  ); 
}

function switchMode() {

}
function App() {
  return (
  <div className="app">
    <div>
      <header>
      <h1 className="text-center text-3xl font-bold underline">
      Hello world!
    </h1>
        <div className='bg'>
          <h1>Social Media Dashboard</h1>
          <p>Total Followers: 23,0004</p>
        </div>
        <div className='flex-1'>
          <p>Dark Mode</p>
          <button className='' onClick={switchMode()}>Switch</button>
        </div>
      </header>
      <div className=''>
        <Summary />
      </div>
      <div className=''>
        <h3>Overview - Today</h3>
        <Overview />
      </div>
    </div>
  </div>
  );
}

export default App
